import React, { useState } from 'react';

const ImageList = ({imageUrls}) => {
    
    return (
        <div>
            {imageUrls ? (
                imageUrls.map((url, index) =>(
                    <img key={index} src={url} alt={`Image ${index}`}
                    style={{ width: '100px', height: '100px' }}/> 
                ))
            ) : (
                <div></div>
            )};
        </div>
    );
}

export default ImageList;
